import { useEffect, useState } from 'react';
import Popup from 'reactjs-popup';
import { useNavigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';

import './reviewform.css';
/*import GiveReviews from './GiveReviews';*/

const Review = () => {
  const navigate = useNavigate();
  const user = useSelector((state) => state.user.user);
  const [reviewData, setReviewData] = useState({});

  const reportData = [
    {
      serialNumber: 1,
      doctorName: 'Dr. Sara Bell',
      doctorSpeciality: 'Dermatology',
      charges: '$88',
      reportUrl: 'https://example-site.com/report-1',
    },
    {
      serialNumber: 2,
      doctorName: 'Dr. John Hash',
      doctorSpeciality: 'Cardiology',
      charges: '$54',
      reportUrl: 'https://example-site.com/report-2',
    },

  ];

  const handleGiveReview = (serialNumber) => {
    setReviewData((prevReviewData) => ({
      ...prevReviewData,
      [serialNumber]: ''
    }));
  };

  const handleReviewSubmit = (serialNumber, review) => {
    setReviewData((prevReviewData) => ({
      ...prevReviewData,
      [serialNumber]: review
    }));
  };

  useEffect(() => {
      if (!user) {
          navigate("/login");
      }
  }, [])

    return ( <>
    <div className="container reviews-container">
    <div >

    <table className="report-table">
        <thead>
          <tr>
            <th>Serial Number</th>
            <th>Doctor Name</th>
            <th>Doctor Speciality</th>
            <th>Charges</th>
            <th>Give Review</th>
            <th>Review Given</th>
          </tr>
        </thead>
        <tbody>
          {reportData.map((report) => (
            <tr key={report.serialNumber}>
              <td>{report.serialNumber}</td>
              <td>{report.doctorName}</td>
              <td>{report.doctorSpeciality}</td>
              <td>{report.charges}</td>
              <td>
                {!reviewData[report.serialNumber] ? (
                  <Popup
                    trigger={
                      <button
                       className="btn-review"
                        onClick={() => handleGiveReview(report.serialNumber)}
                      >
                        Give Review
                      </button>
                    }
                    modal
                    nested
                  >
                    {(close) => (
                      <div>
                        <GiveReviews
                          serialNumber={report.serialNumber}
                          onReviewSubmit={handleReviewSubmit}
                          review={reviewData[report.serialNumber]}
                        />
                        <button className="close-modal-button" onClick={close}>
                          Close
                        </button>
                      </div>
                    )}
                  </Popup>
                ) : (
                  <button className="give-review-button" disabled>
                    Give Review
                  </button>
                )}
              </td>
              <td>
                {reviewData[report.serialNumber] && (
                  <div className="review-given">
                    <p>{reviewData[report.serialNumber]}</p>
                  </div>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>

